.text 
start:
	li $v0, 4				#display welcome
	la $a0, welcome
	syscall
	
	li $v0, 4				#displaye startMenu
	la $a0, startMenu
	syscall
	
	li $v0, 5
	syscall
	
	bgt $v0, 4, start			#check users input
	blt $v0, 0, start			#check users input
	beq $v0, 4, end				#quit
	
	
	addi $s0, $v0, 4			#setup the length of the key

initStoreKey:
	la $t0, key
	li $t1, 0

storeKey:
	li $v0, 42
	li $a1, 26
	syscall
	addi $a0, $a0, 65
	sb $a0, ($t0)
	addi $t0, $t0, 1
	addi $t1, $t1, 1
	blt $t1, $s0, storeKey

#
# setupKeyInt - sets up the integer array by having the correct count of each letter in our key
#	$t0 - address pointer of key
#	$t1 - index of key integer array
#	$t2 - address pointer of key Integer array
#	$t3 - vaule at index of key integer array
#	$t4 - loop counter
#	$s0 - key length

	la $t0, key				#load address of the key into $t0	
setupKeyInt:
	beq $s0, $t4, initScanDictionary	#if loop counter equals key length go to next
	lb $t1, ($t0)				#loading the letter from key
	addi $t1, $t1, -65			#setup index for key integer array
	la $t2, keyInt				#load address of key integer array
	add $t2, $t2, $t1			#compute correct index number
	lbu $t3, ($t2)				#load the vaule at index of integer array
	addi $t3, $t3, 1			#increment the value at index of integer array
	sb $t3, ($t2)				#store new value at index of integer array
	
	#li $v0, 1		DEBUG
	#add $a0, $zero, $t3
	#syscall
	
	addi $t4, $t4, 1			#increment loop counter
	addi $t0, $t0, 1			#increment address pointer of key
	j setupKeyInt				#loop
######
open:
	li $v0, 13				# Open File Syscall
	la $a0, file				# Load File Name
	li $a1, 0				# Read-only Flag
	li $a2, 0				# (ignored)
	syscall
	
	move	$s0, $v0			# Save File Descriptor
	#blt	$v0, 0, fileError		# Goto Error
read:
	li $v0, 14				# Read File Syscall
	move $a0, $s0				# Load File Descriptor
	la $a1, buffer				# Load Buffer Address
	li $a2, 396624				# Buffer Size
	syscall
######

#	$t0 -  dictionary buffer address pointer
#	$t1 - letter at the address of dictionary buffer
#	$t2 - address of dictionary integer array
#	$t3 - value if the letter at dictionary integer array
#	$t4 - address of key integer array
#	$t5 - value of the letter at key integer array
	
initScanDictionary: 
	la $t0, buffer1
	la $s2, twoLetterWords
	la $s3, threeLetterWords
	la $s4, fourLetterWords
	la $s5, fiveLetterWords
	la $s6, sixLetterWords
	la $s7, sevenLetterWords
	sw $zero, howManyTwoLetters
	sw $zero, howManyThreeLetters
	sw $zero, howManyFourLetters
	sw $zero, howManyFiveLetters
	sw $zero, howManySixLetters
	sw $zero, howManySevenLetters
	li $t1, 0
	li $t2, 0
	li $t3, 0
	li $t4, 0
	li $t5, 0

scanDictionary:
	lb $t1, ($t0)				#load the letter from buffer pointer
	beq $t1, 63, Next			#check to see if it is a ? to indicate end of dictionary
	addi $t1, $t1, -65			#setup index pointer
	la $t2, dictionaryInt			#get address of the dictionary integer array
	add $t2, $t2, $t1			#computer the loaction of the index at dictionary integer array
	lbu $t3, ($t2)				#load the vaule of the index at dictionary integer arry (should be a 0)
	addi $t3, $t3, 1			#increment that vaule by one
	la $t4, keyInt				#load address of the key integer array
	add $t4, $t4, $t1			#find the index at the same location as the index of dictionary integer array
	lbu $t5, ($t4)				#load the value from the key integer array
	blt $t5, $t3, NextWord			#if the value from the key integer array is less than the value from the dictionary array go to next word
	sb $t3, ($t2)				#store the value of the dicitonary integer array 
	
	addi $t0, $t0, 1			#increment index of buffer pointer
	lb $t1, ($t0)				#load the letter from buffer pointer
	addi $t1, $t1, -65			#setup index pointer
	la $t2, dictionaryInt			#get address of the dictionary integer array
	add $t2, $t2, $t1			#computer the loaction of the index at dictionary integer array
	lbu $t3, ($t2)				#load the vaule of the index at dictionary integer arry (should be a 0)
	addi $t3, $t3, 1			#increment that vaule by one
	la $t4, keyInt				#load address of the key integer array
	add $t4, $t4, $t1			#find the index at the same location as the index of dictionary integer array
	lbu $t5, ($t4)				#load the value from the key integer array
	blt $t5, $t3, NextWord			#if the value from the key integer array is less than the value from the dictionary array go to next word
	sb $t3, ($t2)				#store the value of the dicitonary integer array 
	
	addi $t0, $t0, 1
	lb $t1, ($t0)				#load the letter from buffer pointer
	beq $t1, 33, FoundTwoLetterWord		#found two letter word, go there
	addi $t1, $t1, -65			#setup index pointer
	la $t2, dictionaryInt			#get address of the dictionary integer array
