			sb $t1, ($t0)				#store back into guessed word
			
itIsUpper:
			addi $t0, $t0, 1			#iterate to the next character in guessed word
			addi $t9, $t9, 1
			j validateGuessInput			#jump back to validate the next character
			#j end
			
nextStepInValidation: 
			li $v0, 4				#print the guessed word
			la $a0, wordGuess
			syscall
			j end
			
wrong:
			la $a0, isWrong				#print wrong
			li $v0, 4
			syscall
			
			
			li $v0, 33				#play incorrect sound
			li $a0, 50
			li $a1, 1000
			li $a3, 127
			syscall
			
			j inGameMenu

correct:
			la $v0, 4				#print correct
			la $a0, isCorrect
			syscall
			
			li $v0, 33				#play correct sound
			li $a0, -20
			li $a1, 1000
			li $a3, 127
			syscall
			
			j inGameMenu
			
gameOver:
			li $v0, 33				#play incorrect sound
			li $a0, 50
			li $a1, 1000
			li $a3, 127
			syscall
			
			li $v0, 4				#print gameover
			la $a0, gameOverString
			syscall
			
			li $v0, 4				#print score
			la $a0, scoreString
			syscall
			
			li $v0, 1
			move $a0, $s1
			syscall
			
			li $v0, 4
			la $a0, newLine
			syscall
			
			li $v0, 4				#press enter to play again
			la $a0, thanksForPlaying
			syscall
			
			li $v0, 11
			syscall
			
			beq $a0, 10, start
			
			j start
			
initGuessWordConvertToIntArray: 
				
				la $t0, wordGuess			#load address of the guess word
				#li $t9, 0
				la $t2, guessWordInt
				sw $zero, ($t2)				#zero the guess word int array
				sw $zero, 4($t2)
				sw $zero, 8($t2)
				sw $zero, 12($t2)
				sw $zero, 16($t2)
				sw $zero, 20($t2)
				sw $zero, 24($t2)
				add $s0, $s0, $zero

guessWordConvertToIntArray:
				lb $t1,($t0)				#get letter from guessWord
				beq $t1, 10, checkGuessWordLength	#if newline go to checkGuessWordLength
				la $t2, guessWordInt			#load address of the guess word int array
				addi $t1, $t1, -65			#subtract 65 in order to get index
				add $t2, $t2, $t1			#calculate index of the guess word int array
				lbu $t3, ($t2)				#load the value of the index of the guess word int array
				addi $t3, $t3, 1			#increment the value of the index of the guess word int array
				la $t4, keyInt				#load address of the key int array
				add $t4, $t4, $t1			#calculate index of the key int array
				lbu $t5, ($t4)				#load the value of the index of the key int array
				blt $t5, $t3, wrong			#branch to wrong if value of the index of the key int array is less than the value of the index of the guess word int array
				sb $t3, ($t2)				#store the value back into the guess word int array
				
				
			#	li $v0, 1
			#	move $a0, $t3
			#	syscall
				
				

				addi $t0, $t0, 1
				#beq $t9, $s0, end
				j guessWordConvertToIntArray
				
